/* List 资金管理/分配规则配置 */

// ==================
// 所需的各种插件
// ==================

import React from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import P from 'prop-types';
import Config from '../../../../config/config';
import { Form, Button, Icon, Input, Table, message, InputNumber, Popover, Modal, Radio, Tooltip, Select, Upload,Tabs, Divider } from 'antd';
import './index.scss';
import tools from '../../../../util/tools'; // 工具
import Power from '../../../../util/power'; // 权限
import { power } from '../../../../util/data';
import _ from 'lodash';
// ==================
// 所需的所有组件
// ==================


// ==================
// 本页面所需action
// ==================

import { findProductByWhere, findProductTypeByWhere, ServiceList,updateServiceList,onChange,addProduct,addMoneyList, updateProduct, updateProductType,deleteProduct,removeProduct, deleteImage, findProductModelByWhere ,upProductModel,MoneyList,updateMoneyList } from '../../../../a_action/shop-action';

// ==================
// Definition
// ==================
const FormItem = Form.Item;
const RadioGroup = Radio.Group;
const Option = Select.Option;
const TabPane = Tabs.TabPane;
class Category extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            mode: 'top',
            data: [], // 当前页面全部数据
            data2: [], // 当前页面全部数据
            productTypes: [],   // 所有的结算类型
            productModels: [],  // 所有的产品型号
            productprice:'',  //产品的价格
            searchTypeId: undefined, // 搜索 - 类型名
            searchName: '', // 搜索 - 名称
            addnewModalShow: false, // 添加新用户 或 修改用户 模态框是否显示
            addnewLoading: false, // 是否正在添加新用户中
            onUpdateClick: false, // 修改经营收益规则时模态框是否显示
            onUpdateClick2: false, // 修改服务收益规则时模态框是否显示
            nowData: null, // 当前选中用户的信息，用于查看详情、修改、分配菜单
            nowData2: null, // 当前选中用户的信息，用于查看详情、修改、分配菜单
            queryModalShow: false, // 查看详情模态框是否显示
            pageNum: 1, // 当前第几页
            pageSize: 10, // 每页多少条
            total: 0, // 数据库总共多少条数据
        };
    }

    componentDidMount() {
        this.getAllProductType();   // 获取所有的结算类型
        this.getAllProductModel();  // 获取所有的产品型号
        this.onGetData(this.state.pageNum, this.state.pageSize);
        this.onGetData2(this.state.pageNum, this.state.pageSize);
    }

    // 查询当前页面经营收益所需列表数据
    onGetData(pageNum, pageSize) {
        const params = {
            pageNum,
            pageSize,
        };
        this.props.actions.MoneyList(tools.clearNull(params)).then((res) => {
            if(res.returnCode === "0") {
                this.setState({
                    data: res.messsageBody.result,
                    pageNum,
                    pageSize,
                    total: res.messsageBody.total,
                });
            } else {
                message.error(res.returnMessaage || '获取数据失败，请重试');
            }
        });
    }

    // 查询当前页面服务收益所需列表数据
    onGetData2(pageNum, pageSize) {
        const params = {
            pageNum,
            pageSize,
        };
        this.props.actions.ServiceList(tools.clearNull(params)).then((res) => {
            if(res.returnCode === "0") {
                this.setState({
                    data2: res.messsageBody.result  || [],
                    pageNum,
                    pageSize,
                });
            } else {
                message.error(res.returnMessaage || '获取数据失败，请重试');
            }
        });
    }

    // 获取所有的结算类型，当前页要用
    getAllProductType() {
        this.props.actions.findProductTypeByWhere({ pageNum: 0, pageSize: 9999 }).then((res) => {
            if(res.returnCode === '0') {
                this.setState({
                    productTypes: res.messsageBody.result,
                });
            }
        });
    }

    // 获取所有产品型号，当前页要用
    getAllProductModel() {
        this.props.actions.findProductModelByWhere({ pageNum:0, pageSize: 9999 }).then((res) => {
            if(res.returnCode === '0') {
                this.setState({
                    productModels: res.messsageBody.result,
                });
            }
        });
    }

    // 工具 - 根据产品型号ID获取产品型号名称
    getNameByModelId(id) {
        const t = this.state.productModels.find((item) => String(item.id) === String(id));
        return t ? t.name : '';
    }

    // 工具 - 根据产品类型ID返回产品类型名称
    getNameByTypeId(id) {
        const t = this.state.productTypes.find((item) => String(item.id) === String(id));
        return t ? t.name : '';
    }


    // 搜索
    onSearch() {
        this.onGetData(this.state.pageNum, this.state.pageSize);
    }

    // 查询某一条数据的详情
    onQueryClick(record) {
        this.setState({
            nowData: record,
            queryModalShow: true,
        });
    }

    // 查看详情模态框关闭
    onQueryModalClose() {
        this.setState({
            queryModalShow: false,
        });
    }

    // 添加新规则模态框出现
    onAddNewShow() {
        const me = this;
        const { form } = me.props;
        form.resetFields([
            'addnewProductType',
            'addnewUserSaleRatio',
            'addnewSupplierRatio',
            'addnewStationRatio',
            'addnewDistributorRatio',
        ]);
        this.setState({
            addnewModalShow: true,
            nowData:null
        });
    }

    // 添加确定
    onAddNewOk() {
        const me = this;
        const { form } = me.props;
        form.validateFields([
            'addnewProductType',
            'addnewUserSaleRatio',
            'addnewSupplierRatio',
            'addnewStationRatio',
            'addnewDistributorRatio'
        ], (err, values) => {
            if (err) { return false; }
            me.setState({
                addnewLoading: true,
            });

            const params = {
                productCode: Number(values.addnewProductType),
                userSaleRatio:Number(values.addnewUserSaleRatio),
                distributorRatio:Number(values.addnewDistributorRatio),
                stationRatio:Number(values.addnewStationRatio),
                supplierRatio:Number(values.addnewSupplierRatio)
            };
                me.props.actions.addMoneyList(params).then((res) => {
                    me.setState({
                        addnewLoading: false,
                    });
                    this.onGetData(this.state.pageNum, this.state.pageSize);
                    this.onAddNewClose();
                }).catch(() => {
                    me.setState({
                        addnewLoading: false,
                    });
                });
        });
    }

    // 添加新用户取消
    onAddNewClose() {
        this.setState({
            addnewModalShow: false,
        });
    }

    //根据code值不同显示的字段不同
    Newproduct(e){
        this.setState({
            code:e
        })
        console.log('e的数值是：',e)
        //产品类型改变时，重置结算类型的值位undefined
        const {form} = this.props;
        form.resetFields(['addnewProduct']);
    }

    // 修改某一条数据 模态框出现
    onUpdateClick(record) {
        const me = this;
        const { form } = me.props;
        console.log('Record：', record);
        form.setFieldsValue({
            upProductType:Number(record.productType),
            upUserSaleRatio:Number(record.userSaleRatio),
            upSupplierRatio:Number(record.supplierRatio),
            upStationRatio:Number(record.stationRatio),
            upDistributorRatio:Number(record.distributorRatio),
        });
        // console.log('是什么：', record);
        me.setState({
            nowData: record,
            upModalShow: true,
        });
    }

    // 确定修改某一条数据
    onUpOk() {
        const me = this;
        const { form } = me.props;
        form.validateFields([
            'upProductType',
            'upUserSaleRatio',
            'upSupplierRatio',
            'upStationRatio',
            'upDistributorRatio'
        ], (err, values) => {
            if(err) { return; }

            me.setState({
                upLoading: true,
            });
            const params = {
                productType:Number(record.productType),
                userSaleRatio:Number(values.upUserSaleRatio),
                distributorRatio:Number(values.upDistributorRatio),
                stationRatio:Number(values.upStationRatio),
                supplierRatio:Number(values.upSupplierRatio)
            };

            this.props.actions.updateMoneyList(params).then((res) => {
                if (res.returnCode === "0") {
                    message.success("修改成功");
                    this.onGetData(this.state.pageNum, this.state.pageSize);
                    this.onUpClose();
                } else {
                    message.error(res.returnMessaage || '修改失败，请重试');
                }
                me.setState({
                    upLoading: false,
                });
            }).catch(() => {
                me.setState({
                    upLoading: false,
                });
            });
        });
    }
    // 关闭修改某一条数据
    onUpClose() {
        this.setState({
            upModalShow: false,
        });
    }

    // 关闭模态框
    onAddNewClose() {
        this.setState({
            addnewModalShow: false,
        });
    }

    // 修改服务收益中某一条数据 模态框出现
    onUpdateClick2(record) {
        const me = this;
        const { form } = me.props;
        console.log('Record：', record);
        form.setFieldsValue({
            upStationRatio:Number(record.stationRatio),
        });
        // console.log('是什么：', record);
        me.setState({
            nowData2: record,
            upModalShow2: true,
        });
    }

    // 确定修改某一条数据
    onUpOk2() {
        const me = this;
        const { form } = me.props;
        form.validateFields([
            'upStationRatio',
            'upUserSaleRatio',
            'upDistributorRatio',
            'upSupplierRatio',
        ], (err, values) => {
            if(err) { return; }

            me.setState({
                upLoading: true,
            });
            const params = {
                productType:Number(record.productType),
                stationRatio:Number(values.upStationRatio),
                userSaleRatio:Number(values.upUserSaleRatio),
                distributorRatio:Number(values.upDistributorRatio),
                supplierRatio:Number(values.upSupplierRatio)
            };

            this.props.actions.updateServiceList(params).then((res) => {
                if (res.returnCode === "0") {
                    message.success("修改成功");
                    this.onGetData(this.state.pageNum, this.state.pageSize);
                    this.onUpClose();
                } else {
                    message.error(res.returnMessaage || '修改失败，请重试');
                }
                me.setState({
                    upLoading: false,
                });
            }).catch(() => {
                me.setState({
                    upLoading: false,
                });
            });
        });
    }
